import 'dart:convert';
import 'dart:ui';

import 'package:flutter/material.dart';
import 'package:house_party/components/outlined_text.dart';
import 'package:house_party/models/product.dart';
import 'package:house_party/pages/product/product_list_controller.dart';

class ProductListPage extends StatefulWidget {
  @override
  _ProductListPageState createState() => _ProductListPageState();
}

class _ProductListPageState extends State<ProductListPage> {
  final ProductListController _productListController = ProductListController.instance;
  List<Product> _productList;

  @override
  Widget build(BuildContext context) {
    int idCategory = ModalRoute.of(context).settings.arguments;

    return Scaffold(
      appBar: AppBar(
        title: OutlinedText('House Party', fontSize: 22,),
      ),

      body: FutureBuilder(
        future: this._productListController.productWebClient.findByCategory(idCategory),
        builder: (context, snapshot) {
          switch(snapshot.connectionState) {
            case ConnectionState.none:
              break;
            case ConnectionState.waiting:
              return Center(
                child: CircularProgressIndicator(),
              );
              break;
            case ConnectionState.active:
              break;
            case ConnectionState.done:
              if(snapshot.data == null) {
                return Center(
                    child: Text(
                      'Error',
                      style: TextStyle(
                          fontSize: 28
                      ),
                    )
                );
              }
              this._productList = snapshot.data;
              return GridView.builder(
                padding: const EdgeInsets.all(8.0),
                gridDelegate: SliverGridDelegateWithFixedCrossAxisCount(
                    crossAxisCount: 2
                ),
                itemCount: this._productList.length,
                itemBuilder: (context, index) => Card(
                  child: Padding(
                    padding: const EdgeInsets.all(8.0),
                    child: Column(
                      children: [
                        Flexible(
                          child: Image.memory(
                            base64Decode('')
                          ),
                        ),
                        Text(
                          this._productList[index].description,
                          textAlign: TextAlign.center,
                          style: TextStyle(
                            fontSize: 16
                          ),
                        ),
                        Row(
                          mainAxisAlignment: MainAxisAlignment.spaceEvenly,
                          children: [
                            IconButton(
                              icon: Icon(
                                Icons.remove_circle,
                                color: Colors.red[400],
                                size: 28,
                              ),
                              onPressed: () {},
                            ),
                            Text('0', style: TextStyle(fontSize: 28),),
                            IconButton(
                              icon: Icon(
                                Icons.add_circle,
                                color: Colors.green[400],
                                size: 28,
                              ),
                              onPressed: () {},
                            ),
                          ],
                        )
                      ],
                    ),
                  ),
                ),
              );
              break;
          }
          return Center(
            child: Text(
              'Error',
              style: TextStyle(fontSize: 28),
            ),
          );
        },
      )

    );
  }
}
